import React from 'react';

const Session = ({ session, onDelete }) => {
    return (
      <div key={session.sessionId}>
        <p>Session ID: {session.sessionId}</p>
        <button onClick={() => onDelete(session.sessionId)}>Delete Session</button>
      </div>
    );
  };

export default Session;
